  render() {
    return (
      <div>
        <Link to="">Home</Link>
            <Link to="">Photography</Link>
            <Link to="">Gallery</Link>
            <Link to="">About</Link>
            <Link to="">Contact</Link>
    
      </div>
    )
  }
}
